      string: '{"id":968051,"page":1,"results":[{"author":"s.rinky","author_details":{"name":"","username":"s.rinky","avatar_path":null,"rating":null},"content":"Despite
        having such a strong central character on its poster with a great back story,
        ''The Nun 2'' spends more time on the pauses and long dialogue scenes than
        on the scares. ''Nun the less'', watch it if you are invested in the ''Conjuring''
        universe.","created_at":"2023-10-06T20:47:54.976Z","id":"6520727aea84c700eb9cac50","updated_at":"2023-10-06T22:48:12.237Z","url":"https://www.themoviedb.org/review/6520727aea84c700eb9cac50"},{"author":"CinemaSerf","author_details":{"name":"CinemaSerf","username":"Geronimo1967","avatar_path":"/1kks3YnVkpyQxzw36CObFPvhL5f.jpg","rating":6.0},"content":"Five
        years on from her first outing, Taissa Farmiga dons her holy robes to return
        as the nun who is a dab hand at facing down satanic apparitions. It''s France
        in the 1950s and a priest is seized in his own church and brutally killed.
        Not by a person though - and that''s where \"Sister Irene\" comes in. Fairly
        quickly her investigations take her to a girl''s school where a previous tragedy
        has left a room completely sealed off and that''s where she senses the source
        of this evil may be lurking. Can she figure out who this demon is and thwart
        it''s ambitions - ambitions that really centre on the absorption of her own,
